INSERT INTO `portal_contract` VALUES (1,'media','Media Consent','By submitting this application for admission to Mount Carmel School, I consent to photos, audio and video recordings and transmissions, quotes, and/or likenesses of my child/ward to be used appropriately and ethically for all relevant school related  media, including, but not limited to, the school\'s website, the school\'s YouTube channel, social media outlets, the school yearbook, print and video advertisements for the school, school press releases, school newsletters and bulletins, and print and broadcast news coverage about school events and activities. In order to deny this consent, parent(s)/guardian(s) must submit such denial in writing with the signature(s) of the said parent(s)/guardian(s) affixed to the document.','2019-03-10 05:19:11.888762'),(2,'legal','Necessary Documentation','Please indicate below any documentation that you believe would be necessary for the school to be provided, such as court orders for legal guardianship or custody, immigration visas, or medical diagnoses. Such documentation must be submitted before your child\'s first day of classes, along with copies of birth certificates/passports (for new students), academic transcripts (for new students), and current immunization records (for all students).','2019-03-14 09:43:17.371428');
