INSERT INTO `portal_mailtemplate` VALUES (1,'2020','2020 Application Response','First letter to acknowledge registration','<h4>Application Received</h4><br>\r\n	Dear {parent},<br><br>\r\n	<p>Greetings from Mount Carmel School!</p>\r\n	<p>This is to acknowledge that we have received an application on behalf of {student}, for  enrollment  into Mount Carmel School Grade {grade} for the upcoming {long_schoolyear} school year.</p>\r\n<p>We will contact you soon with further information on the progress of {student}\'s application.</p>\r\n<br>  \r\n	<p>Thank you again for choosing Mount Carmel School for the education of your child.</p>\r\n	<p>As we say often, and mean every single time, we remain committed to our mission to educate \r\n	 the whole child to see with Christ\'s eyes.</p><br>\r\n	<p>Sincerely in Christ,</p><br>\r\n\r\n	<p>Galvin Deleon Guerrero<br>\r\n		President</p>\r\n	<p>Mount Carmel School, Inc.<br>\r\n			P. O. Box 500006<br>\r\n			Saipan, MP 96950<br>\r\n			670.234.6184<br>\r\n			670.235.4751 (fax)<br>\r\n	<ul style=\"list-style:none\">\r\n		<li>galvin.deleonguerrero@gmail.com</li>\r\n		<li>president.mcs@pticom.com</li>\r\n		<li>www.mountcarmelsaipan.com</li>\r\n		<li>www.facebook.com/mtcarmelcnmi</li>\r\n	</ul>','2020-03-19 06:26:29.790765',0),(2,'2020','2020 Acceptance Letter','Accepted for Registration','<h4> Acceptance Letter</h4><br>\r\n	Dear {parent},<br><br>\r\n	<p>Greetings from Mount Carmel School!</p>\r\n	<p>I write to notify you that {student}, has been accepted into Mount Carmel School for the upcoming {schoolyear} school year.  \r\n	We are very excited to have {student} \r\n			joining the Mount Carmel School family and thank you for choosing our school for your child.</p>\r\n	<p>Now that your child has been accepted, please note that you must still provide the following to complete \r\n		the enrollment process for SY ({schoolyear})</p>\r\n		<ul>\r\n		<li> updated health certificate</li>\r\n		<li>records from last school attended (for new students only)</li>\r\n	  <li>and birth certificate (for first grade and new students only)</li>\r\n		</ul>\r\n		<br>\r\n	<p>You may submit these documents either to the Business Office or the main office. Also, you will \r\n	be required to sign an Educational Services Agreement form, which the Business Office will provide \r\n	before the opening of the school year.</p>\r\n	\r\n	<p>Once all documents have been submitted and all registration and activity fees have been paid, we will send an \r\n	email confirming {student}\'s enrollment.\r\n\r\n	<p> As you and {student} prepare for the school year, feel free to learn more about the school\r\n	  and keep track of updates from our website, our Facebook page, and our Twitter feed.</p>\r\n\r\n\r\n	<p>The addresses for all of these information outlets are listed in the footer of this message.</p>\r\n	\r\n	<p>For now, you should know that the first day of school will be on August 6, 2020</p>\r\n	<p>Thank you again for choosing Mount Carmel School for the education of your child.</p>\r\n	<p>As we say often, and mean every single time, we remain committed to our mission to educate \r\n	 the whole child to see with Christ\'s eyes.</p><br>\r\n	<p>Sincerely in Christ,</p><br>\r\n\r\n	<p>Galvin Deleon Guerrero<br>\r\n		President</p>\r\n	<p>Mount Carmel School, Inc.<br>\r\n			P. O. Box 500006<br>\r\n			Saipan, MP 96950<br>\r\n			670.234.6184<br>\r\n			670.235.4751 (fax)<br>\r\n	<ul style=\"list-style:none\">\r\n		<li>galvin.deleonguerrero@gmail.com</li>\r\n		<li>president.mcs@pticom.com</li>\r\n		<li>www.mountcarmelsaipan.com</li>\r\n		<li>www.facebook.com/mtcarmelcnmi</li>\r\n	</ul>','2020-03-16 00:08:28.492267',1),(3,'2020','2020 Enrollment Letter','Enrollment letter to families.','																																																											<h4> Enrollment Letter</h4><br>\r\n	Dear {parent},<br><br>\r\n	<p>Greetings from Mount Carmel School!</p>\r\n	<p>I write to notify you that {student}, has been enrolled into Mount Carmel School for \r\n			grade level {grade} for the upcoming {schoolyear} school year.  We are very excited to have {student} \r\n			join the Mount Carmel School family and thank you for choosing our school for your child.</p>\r\n	<p> As you and  {student}  prepare for the school year, feel free to learn more about the school and keep track of updates from our website, our social media platforms, and our YouTube channel. The addresses for all of these information outlets are listed in the footer of this message.</p>\r\n	<p>For now, you should know that the first day of school will be August 6, 2020</p>\r\n	<p>Thank you again for choosing Mount Carmel School for the education of your child.</p>\r\n	<p>As we say often, and mean every single time, we remain committed to our mission to educate \r\n	 the whole child to see with Christ\'s eyes.</p><br>\r\n	<p>Sincerely in Christ,</p><br>\r\n\r\n	<p>Dr. Galvin Deleon Guerrero<br>\r\n		President</p>\r\n	<p>Mount Carmel School, Inc.<br>\r\n			P. O. Box 500006<br>\r\n			Saipan, MP 96950<br>\r\n			670.234.6184<br>\r\n			670.235.4751 (fax)<br>\r\n	<ul style=\"list-style:none\">\r\n		<li>galvin.deleonguerrero@gmail.com</li>\r\n		<li>president.mcs@pticom.com</li>\r\n		<li>www.mountcarmelsaipan.com</li>\r\n		<li>www.facebook.com/mtcarmelcnmi</li>\r\n	</ul>\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				','2020-05-15 07:06:32.024364',2),(4,'2020','SY 2020-2021 Pre-Launch Round Table on July 22 at 5pm on Facebook','','<img width=\"600px\" src=\'https://portal.mcsaipan.net/static/img/MCS_RoundTable.png\'>\r\n<br>\r\n				\r\n<h4>Join us online for our SY 2020-2021 Pre-Launch Round Table <br>\r\nwhere well share important information and answer your <br>\r\nquestions about the new school year.<br><br>\r\n\r\nThe online assembly will be streamed on the<br>\r\n MCS Facebook Page<br> @mtcarmelcnmi on Wednesday July 22 at 5:00 pm.	</h4>','2020-07-16 00:38:26.017161',4),(5,'2020','SY 2020-2021 Launch Delayed','Launch Delayed Letter','										<p>Dear Mount Carmel School Family,</p>\r\n\r\n<p>May the Peace of Christ be with you all as we all continue to deal with the coronavirus pandemic. Indeed, during turbulent times like these, we all need peace in our lives and in our hearts.</p>\r\n\r\n<p>I write to you about a very important announcement regarding the 2020-2021 school year. Recently, we learned that two items we invested in that are critical for student safetyultraviolet lighting fixtures for air conditioners and plexiglass cubicles for student deskswill be delayed due to various issues with manufacturing, shipping, and global demand. These items have been ordered and paid for, but they will not arrive until later in August.</p>\r\n\r\n<p>Because we are prioritizing the safety of our students and employees above all else during this pandemic, we have decided to delay the start of the school year as follows:</p>\r\n\r\n\r\n<p><strong>August 17: Launch of Online Remote Learning</strong></p>\r\n\r\n<p>On Monday, August 17, we will start the school year with online remote learning for all grades. Students in Kindergarten through 6th grade will have daily synchronous learning, while students in 7th through 12th grade will alternate between synchronous learning twice a week and asynchronous the rest of the week. We need time between now and August 17 to reconfigure our schedule, curriculum, and technology to prepare for this online remote learning. More details about how to access online remote learning will be provided to students and their families next week.\r\n</p>\r\n<p><strong>August 31: Launch of Face-to-Face Learning</strong></p>\r\n\r\n<p>Anticipating that classrooms will be safe and ready by the end of August, we are targeting the launch of face-to-face learning for Monday, August 31. We will begin offering face-to-face learning with the lower grades and work our way up to high school as the ultraviolet units and plexiglass cubicles arrive.</p>\r\n\r\n<p><strong>School Year NOT Extended</strong></p>\r\n\r\n<p>While we are delaying the start of the school year, barring any unforeseen circumstances, we still plan to end the school year as scheduled on May 26, 2021. Details about calendar adjustments are forthcoming.</p>\r\n\r\n<p>In the meantime, please take a moment to review the following resources that will help keep our school and our community safe:</p>\r\n<ul>\r\n    <li><a href=\"https://portal.mcsaipan.net/static/pdf/MCS_COVID-19_Policies_&_Procedures.pdf\"> Mount Carmel School Policies and Procedures for COVID-19 Prevention and Control</a></li>\r\n    <li> <a href=\"https://www.cdc.gov/coronavirus/2019-ncov/prevent-getting-sick/prevention.html\">How to Protect Yourself & Others </a> (from the Centers for Disease Control and Prevention)</li>\r\n    <li><a href=\"https://governor.gov.mp/covid-19/\">Latest Information on Coronavirus Disease 2019 (COVID-19)</a> (from the CNMI Office of the Governor)</li>\r\n    <li><a href=\"https://www.chcc.gov.mp/DocumentFiles/coronavirusinformation_280_1887412257.pdf\">Commonwealth Healthcare Corporation COVID-19 Guidebook</a></li>\r\n</ul>\r\n\r\n<p>We thank you for your patience and understanding.  As we have shared before, because this is a dynamic situation that changes on a daily basis, the future is uncertain and many questions still remain. The schools Leadership Team, guided by Bishop Ryan P. Jimenez and the schools Board of Directors, are making decisions based on the best and most accurate information available at any given time. Please be assured that no matter what we do, we will provide ample notification and information to all students, parents, teachers, and families via email, our website, all our social media outlets, and local media. In other words, you will definitely hear from us and know what to do.</p>\r\n\r\n<p>These are challenging times, but we have survived devastating typhoons, economic recessions, and many other tragedies. With FAITH in our Lord, HOPE for a better tomorrow, and LOVE for each other, we will get through this together. We are</p>\r\n\r\n\r\n<p>Our Lady of Mount Carmel</p>\r\n\r\n\r\nGalvin Deleon Guerrero, EdD<br>\r\nPresident<br>\r\nMount Carmel School, Inc.<br>\r\nP. O. Box 500006<br>\r\nSaipan, MP 96950<br>\r\n670.234.6184<br>\r\n670.235.4751 (fax)<br>\r\n<a href=\"galvin.deleonguerrero@gmail.com\">galvin.deleonguerrero@gmail.com</a>.<br>\r\n<a href=\"president.mcs@pticom.com\">president.mcs@pticom.com</a>.<br>\r\n<a href=\"www.mountcarmelsaipan.com\">www.mountcarmelsaipan.com</a>.<br>\r\n<a href=\"www.facebook.com/mtcarmelcnmi\">www.facebook.com/mtcarmelcnmi</a>.<br>\r\n<a href=\"www.instagram.com/mcsknights\">www.instagram.com/mcsknights.</a><br>\r\nFollow us on Twitter @MCS_KNIGHTS<br>\r\nLearn more about me on LinkedIn at<br>\r\n<a href=\"https://www.linkedin.com/in/galvin-deleon-guerrero-edd-68225998/\">https://www.linkedin.com/in/galvin-deleon-guerrero-edd-68225998/</a>.<br>\r\n<br><br>\r\n\r\n<small><p>This email is protected by the Electronic Communications Privacy Act. 18 U.S.C.. Sections 2510-2521 and is legally privileged.  The information contained in this email is only for the use of the individual or entity named above.  It may contain confidential information that is protected from disclosure by the attorney-client privilege, as attorney work product, or by other privileges.  If you are not the intended recipient, or the employee or agent responsible to deliver it to the intended recipient, any dissemination, distribution, or copying of this message is strictly prohibited.  If you have received this message in error, please send a note in reply and destroy the original message. If you have read this message so meticulously that you have reached this part of the message, then you should consider a career in law because boy do you read the fine print.  Thank you.</p></small>\r\n				\r\n				','2020-07-28 04:46:15.146173',4),(6,'2020','SCHOLARSHIP/FINANCIAL AID NOTIFICATIONS','','																				<h3>SCHOLARSHIP/FINANCIAL AID NOTIFICATIONS </h3>\r\n<h5>TO BE ISSUED BY NEXT WEEK FRIDAY, AUGUST 7</h5>\r\n<br>\r\nDue to an unprecedented number of applications for scholarships and financial aid, and given the delayed start of the 2020-2021 school year, Mount Carmel School will issue scholarship and financial aid notifications by next week Friday, August 7. <br>\r\nWe thank you for your patience, understanding, and support.\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				','2020-07-31 04:00:38.858115',4),(7,'2020','Student Resource Pick-Up Schedule (August 10-14)','Student Resource Pick-up','																																																		<p>	Dear Mount Carmel School Family,</p>\r\n\r\n\r\n\r\n<p>I hope and trust all is well with you during these challenging times. As we prepare to launch online remote learning on Monday, August 17, we want to share with you important information about how we will distribute student schedules, textbooks, online activation codes, and other learning resources.</p>\r\n\r\n<p>We invite students and families to pick up these resources according to the following Student Resource Pick-Up Schedule:</p>\r\n<ul>\r\n<li> Monday, August 10  <br>\r\n8:00 am - 11:00 am:  K4, K5, and 1st Grade<br>\r\n1:00 pm - 4:00 pm: 2nd and 3rd Grades<br>\r\n</li>\r\n<br>\r\n<li>\r\nTuesday, August 11<br>\r\n8:00 am - 11:00 am: 4th and 5th Grades<br>\r\n1:00 pm - 4:00 pm: 6th Grade<br>\r\n</li>\r\n<br>\r\n</i>\r\nWednesday, August 12<br>\r\n8:00 am - 11:00 am: 7th Grade<br>\r\n1:00 pm - 4:00 pm: 8th Grade<br>\r\n</li>\r\n<br>\r\n<li>\r\nThursday, August 13<br>\r\n8:00 am - 11:00 am: 9th Grade<br>\r\n1:00 pm - 4:00 pm: 10th Grade<br>\r\n</li>\r\n<br>\r\n<li>\r\nFriday, August 14<br>\r\n8:00 am - 11:00 am: 11th Grade<br>\r\n1:00 pm - 4:00 pm: 12th Grade<br>\r\n</li>\r\n</ul>\r\n\r\n<br>\r\n\r\n<p>As much as possible, we ask all families and students to follow this schedule in order to avoid congestion on campus and maintain safe physical distancing. While on campus, face masks or face shields are mandatory. When you get on campus, you will be administered a temperature/symptom check and directed to your child\'s respective homeroom. All resources will be distributed within the homeroom. Also, please maintain a physical distance of at least six feet from others and follow all faculty/staff directions and physical distancing markers while on campus.</p>\r\n\r\n<p>Lastly, the <a href=\"https://portal.mcsaipan.net/static/pdf/MCS_Parent_Guide_to_Online_Learning.pdf\"> Mount Carmel School\'s Parent Guide for Online Learning</a> contains helpful information about the primary digital tools and platforms we will use to launch the school year.</p>\r\n\r\n<p>We thank you for your patience and understanding.  As we have shared, before, because this is a dynamic situation that changes on a daily basis, the future is uncertain and many questions still remain. The school\'s Leadership Team, guided by Bishop Ryan P. Jimenez and the school\'s Board of Directors, are making decisions based on the best and most accurate information available at any given time. Please be assured that no matter what we do, we will provide ample notification and information to all students, parents, teachers, and families via email, our website, all our social media outlets, and local media. In other words, you will definitely hear from us and know what to do.</p>\r\n\r\n<p>These are challenging times, but we have survived devastating typhoons, economic recessions, and many other tragedies. With FAITH in our Lord, HOPE for a better tomorrow, and LOVE for each other, we will get through this together. We are KNIGHT STRONG. We are MARIANAS STRONG</p>\r\n<br>\r\n\r\n<p>Our Lady of Mount Carmel</p>\r\n<br>\r\n\r\nGalvin Deleon Guerrero, EdD<br>\r\nPresident<br>\r\nMount Carmel School, Inc.<br>\r\nP. O. Box 500006<br>\r\nSaipan, MP 96950<br>\r\n670.234.6184<br>\r\n670.235.4751 (fax)<br>\r\n<a href=\"galvin.deleonguerrero@gmail.com\">galvin.deleonguerrero@gmail.com</a>.<br>\r\n<a href=\"president.mcs@pticom.com\">president.mcs@pticom.com</a>.<br>\r\n<a href=\"www.mountcarmelsaipan.com\">www.mountcarmelsaipan.com</a>.<br>\r\n<a href=\"www.facebook.com/mtcarmelcnmi\">www.facebook.com/mtcarmelcnmi</a>.<br>\r\n<a href=\"www.instagram.com/mcsknights\">www.instagram.com/mcsknights.</a><br>\r\nFollow us on Twitter @MCS_KNIGHTS<br>\r\nLearn more about me on LinkedIn at<br>\r\n<a href=\"https://www.linkedin.com/in/galvin-deleon-guerrero-edd-68225998/\">https://www.linkedin.com/in/galvin-deleon-guerrero-edd-68225998/</a>.<br>\r\n<br><br>\r\n\r\n<small><p>This email is protected by the Electronic Communications Privacy Act. 18 U.S.C.. Sections 2510-2521 and is legally privileged.  The information contained in this email is only for the use of the individual or entity named above.  It may contain confidential information that is protected from disclosure by the attorney-client privilege, as attorney work product, or by other privileges.  If you are not the intended recipient, or the employee or agent responsible to deliver it to the intended recipient, any dissemination, distribution, or copying of this message is strictly prohibited.  If you have received this message in error, please send a note in reply and destroy the original message. If you have read this message so meticulously that you have reached this part of the message, then you should consider a career in law because boy do you read the fine print.  Thank you.</p></small>\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				','2020-08-04 03:19:27.570867',4),(8,'2020','Online Learning Orientation (August 12 or 13)','Online Learning Orientation (August 12 or 13)','<img src=\"http://portal.mcsaipan.net/static/img/email2.png\" width=800\r\n    alt=\"Online Launch Orientation image\">','2020-08-07 06:28:57.222548',4),(9,'2020','Student Resource Pick-Up Schedule (Aug 10 - 14)','Student Resource Pick-Up Schedule','<img src=\"http://